import React from 'react'

export default function Forgotpassword() {
  return (
    <div className='forgot'>
        <form action="">
            <label htmlFor="">Enter Registered mail id</label>
            <input type="text" />
            <button>SEND</button>
        </form>
    </div>
  )
}
